import { Component, ViewEncapsulation } from '@angular/core';
import { Actor } from './components/Actor/alta/alta.component';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
}

export class Pelicula {
  Id : number;
  nombre: string;
  fechaEstreno : string;
  tipo: string;
  fotoPelicula : string;
  cantidadPersonas: number;
  actor : Actor;

  constructor(id : number =0 , nombre :string="", fechaEstreno : string=" ", tipo: string= "", fotoPelicula : string  = "", cantidadPersonas: number =0, actor : Actor)
  {
    this.Id =id;
    this.cantidadPersonas = cantidadPersonas;
    this.fechaEstreno = fechaEstreno;
    this.fotoPelicula = fotoPelicula;
    this.nombre = nombre;
    this.tipo = tipo;
    this.actor = actor;
  }
}
